import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search_input.png'));

    // Click on search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_clicked_search_button.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_clicked_search_button.png'));

    // Wait for search results to load
    await page.waitForSelector('.search-results', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_results_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_results_loaded.png'));

    // Extract search result titles
    const titles = await page.$$eval('.product-title', elements => elements.map(el => el.textContent));

    return {
      success: true,
      action: "Performed search for 'iPhone' and loaded results",
      extractedData: { titles },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
